def can_place_dominoes(n: int, m: int, k: int) -> bool:
    """"""
    if m == 1:
        return k == 0
    total = n * m // 2
    maxh = n * (m // 2)
    maxv = n // 2 * m
    minh = total - maxv
    if k == minh or k == maxh:
        return True
    if k < minh or k > maxh:
        return False
    if m == 2:
        if n % 2 == 1 and k % 2 == 0:
            return False
        if n % 2 == 0 and k % 2 == 1:
            return False
    elif m != 2 and (k - minh) % 2 == 1:
        return False
    return True
